import { Card as Base } from '@material-ui/core';
import PropTypes from 'prop-types';

class ListCard extends Component {

  render() {
    const{

      items
    } = this.props

    return (
      <Base>
        items={items}


      </Base>
    );
  }
}

ListCard.propTypes = {


     items: PropTypes.oneOf(['1', '2', '3', '4'])

};

ListCard.defaultProps = {

};

export default ListCard;
